    //         : {})
    //     }
    //   };
    // }
    componentDidMount() {
      register();
    }
    render() {
      const { Component, pageProps, store, stars, ctx } = this.props;
      console.log(
        "Compo===>",
        Component,
        "============= page props",
        pageProps
      );
      return (
        <Provider store={store}>
          <Component store={store.getState()} stars={stars} ctx={ctx} />
        </Provider>
      );
    }
  }
);
